import './popup.scss';

const Popup = (props) => {
  return (props.trigger) ? (
    <div className="pop-up">
      <div className="pop-up_inner">
        <h1>Вытаэмо у кондитерській короисних солодощів</h1>
        <div></div>
      </div>
    </div>
  ) : ""
} 

export default Popup;
